import List from './List.react';
import React, { Component, PropTypes as RPT } from 'react';
import { Actions } from 'react-native-router-flux';
import { inject, observer } from 'mobx-react/native';
import { TabBarIOS } from 'react-native';

const czIcon = 'data:image/png;base64,';
const ruIcon = 'data:image/png;base64,';
const tagsIcon = 'data:image/png;base64,';

@inject('store')
@observer
export default class ListPage extends Component {

  static propTypes = {
    data: RPT.string,
    store: RPT.object.isRequired
  }

  render() {
    const { data: tag, store: { language, setLanguage } } = this.props;

    return (
      <TabBarIOS
        barTintColor="#F9F9F9"
        tintColor="#000000"
        unselectedTintColor="#8E8E8E"
        translucent
      >
        <TabBarIOS.Item
          title="Czech"
          renderAsOriginal
          icon={{ uri: czIcon, scale: 4 }}
          selected={language === 'cz'}
          onPress={() => { setLanguage('cz'); }}
        >
          <List tag={tag} />
        </TabBarIOS.Item>

        <TabBarIOS.Item
          title="Russian"
          renderAsOriginal
          icon={{ uri: ruIcon, scale: 4 }}
          selected={language === 'ru'}
          onPress={() => { setLanguage('ru'); }}
        >
          <List tag={tag} />
        </TabBarIOS.Item>

        <TabBarIOS.Item
          title="Tags"
          renderAsOriginal
          icon={{ uri: tagsIcon, scale: 4.2 }}
          selected={false}
          onPress={Actions.tags}
        />
      </TabBarIOS>
    );
  }
}
